INSERT INTO `pages` (`id`, `used`, `title`, `content`, `status`, `meta`, `author`, `created_at`, `updated_at`, `deleted_at`) VALUES
(9, 0, 'About Us', '<p>Archineer Associates Co.,Ltd. is a multi-disciplines consulting service firm that provides Architecture and Engineering integrated design and consulting services to clients across an expansive range of markets and localities. Our multi-disciplinary services; Architecture, Civil &amp; Structural engineering, Mechanical Electrical and Plumbing engineering, Hydropower engineering, Urban development and infrastructure project planning and management ; join forces, knowledge and experience to give you a single point of contact and a strong business relationship you can count on. Our headquarters office is located at Saphangmor village, Saysetha district, Vientiane Capital, Lao PDR where we have started doing business.</p>\n\n<p><img alt=\"\" src=\"https://archiineergroup.la/images/upload/1570191143.jpg\" style=\"width:100%\" /></p>', 2, 'About Archineer, About Archineer Associates, About Archineer Laos, About Archiineergroup, About Archiineer group', 1, '2019-10-04 19:13:37', '2019-10-04 19:27:07', NULL),
(10, 0, 'Our Services', '<p>Archineer Associates has developed a wide range of full in-house integrated services from Project Planning and management, Architecture, Civil and Structural Engineering, Mechanical &amp; Electrical Engineering, and construction supervision and administration service to offer our clients comprehensive solutions.</p>\n\n<p><img alt=\"\" src=\"https://archiineergroup.la/images/upload/1570192152.jpg\" style=\"width:100%\" /></p>', 2, 'Archineer Services, Archineer Associates Services, Archineer Laos Services', 1, '2019-10-04 19:29:42', '2019-10-04 19:29:42', NULL),
(11, 0, 'Careers', '<p>Welcome to Careers at ArchiineerGroup</p>\n\n<p>We are always looking for exceptional people to join our innovative, international team. There are a wide range of opportunities, in both design and Project management roles across a number of locations. Our studio is made up of experienced professionals from a range of disciplines. The culture of the practice is open and dynamic and we welcome the very best talent from around the globe.</p>\n\n<p><strong>Vacancies</strong><br />\nTo search or browse our job vacancies, please click on the links below.</p>\n\n<ul>\n	<li>+Architect</li>\n	<li>+ Interior Designer</li>\n	<li>&nbsp; &nbsp; &nbsp;- Contact us about this vacancy</li>\n	<li>+ Structure Engineering</li>\n	<li>+ Electrical Engineering</li>\n	<li>+ Plumbing Engineering</li>\n	<li>+ Graphic Designer</li>\n</ul>', 2, NULL, 1, '2019-10-04 19:31:48', '2019-10-04 19:31:48', NULL),
(12, 0, 'Discover', NULL, 2, NULL, 1, '2019-10-04 19:32:31', '2019-10-04 19:32:31', NULL),
(13, 0, 'News', '<p>Ground breaking ceremony for Star Telecom Head Quarter Construction Project on may 05, 2015</p>\n\n<p><img alt=\"\" src=\"https://archiineergroup.la/images/upload/1570192436.jpg\" style=\"width:50%\" /><img alt=\"\" src=\"https://archiineergroup.la/images/upload/1570192461.jpg\" style=\"width:50%\" /></p>\n\n<p>&nbsp;</p>\n\n<p><img alt=\"\" src=\"https://archiineergroup.la/images/upload/1570192515.jpg\" style=\"width:50%\" /><img alt=\"\" src=\"https://archiineergroup.la/images/upload/1570192536.jpg\" style=\"width:50%\" /></p>', 2, NULL, 1, '2019-10-04 19:35:55', '2019-10-04 19:35:55', NULL),
(14, 0, 'Contact', '<div class=\"col-lg-6\"><b>Headquarter</b><br />\n    <span class=\"contact\"> House #571, Unit 10, Saphangmor Village <br />\n        Saysettha District, Vientiane Capital, Lao PDR <br />\n        Tel: +856-21-454 354, +856-21-265 535\n        Fax: +856-21-265 536 <br />\n        Email: office@archiineergroup.la,\n        www.archiineergroup.la</span><br><br>\n\n    <b>Project Businese Development</b><br>\n    Email: bd@archiineergroup.la\n    <br><br>\n    <b>Press</b><br>\n    Please send your publication request to :\n    Email: pr@archiineergroup.la\n    <br><br>\n\n    <b>Job</b><br>\n    Email: hrm@archiineergroup.la\n    <br><br>\n    <b>Internship</b><br>\n    Email: internship@archiineergroup.la\n\n\n</div>\n\n\n\n<div class=\"col-lg-6\">\n\n    <div class=\"panel-body\">\n        <iframe\n            src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3795.306184611456!2d102.63201351462091!3d17.964486387735207!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x0!2zMTfCsDU3JzUyLjIiTiAxMDLCsDM4JzAzLjEiRQ!5e0!3m2!1sen!2sla!4v1536570038833\"\n            height=\"450\" frameborder=\"0\" style=\"border:0; width: 100%\" allowfullscreen></iframe>\n    </div>\n</div>', 2, NULL, 1, '2019-10-04 19:38:15', '2019-10-04 19:40:21', NULL);
INSERT INTO `posts` (`id`, `title`, `content`, `status`, `meta`, `belong_to_project`, `author`, `created_at`, `updated_at`, `deleted_at`) VALUES
(27, 'Company Background', '<p>Archineer Associates was established in 2010. Originally Archineer Associates providing Architecture and Structural Engineering design and consulting services. We expanded to include civil engineering, mechanical electrical and plumbing engineering, site investigation and analysis, Land use &amp; Urban planning and development, and infrastructure project planning &amp; management. Since then, Archineer Associates has grown rapidly, from 5 to 100 plus employees. Our clients immediately benefited from the all-inclusive range of developmental services.<br />\n<br />\nIn 2015, Archineer Associates in cooperated with ILF consulting Engineers, Austria (ASIA office) bringing international long standing experiences in the field of hydropower engineering consulting services in order to facilitate our long and well cooperated client&rsquo;s energy business development.<br />\n<br />\nOur creative staffs of Architects, Experienced Engineers provides the expertise, professionalism and innovative approaches fundamental to the execution of successful design solutions. Archineer Associates is committed to clients from pre-design through completion ensuring dedication, continuity and satisfaction.<br />\nArchineer Associates holds a standard of consistently delivering high-quality, client-oriented design, shaped by sound environmental solutions; places that are beneficial to the user as well as the environment.</p>\n\n<p><img alt=\"\" src=\"https://archiineergroup.la/images/upload/1570193122.jpg\" style=\"width:100%\" /></p>', 2, NULL, 0, 1, '2019-10-04 19:45:47', '2019-10-04 20:42:04', NULL),
(28, 'Philosophy', '<p>As design Professionals, we appreciate our responsibility to shape the built environment thoughtfully to create places that enrich and stimulate our lives. We are dedicated to offer new ideas and innovative approaches to design while considering the constructability of those designs as being essential.<br />\nSustainability is a critical aspect of design which Archineer Associates encourages clients to assimilate with their project whenever possible. Energy efficiency and effectiveness are valued equally with design excellence.<br />\nOur staff offers their expertise in green and sustainable practices and vies to include these practices in everyday design. Archineer Associates aims to minimize the impact on the environment and acknowledges the social accountability of built space and infrastructure for sustainability, longevity and quality of living. We are passionate about what we do and strive to be the best.</p>\n\n<p><img alt=\"\" src=\"https://archiineergroup.la/images/upload/1570196915.jpg\" style=\"width:100%\" /></p>', 2, NULL, 0, 1, '2019-10-04 20:49:32', '2019-10-04 20:49:32', NULL),
(29, 'Architecture / Interior / Landscape', '<p>We have been providing Architectural Services to an expansive range of markets and localities since established. Our professional staff of Architects and 3-D Computer Rendering Experts provides the professionalism and innovative approaches fundamental to the execution of successful design solutions. From conceptual design through construction administration our Design Team integrates technical expertise, construction knowledge, and conceptual 3-D visualization to produce the optimal design solution.<br />\n<br />\nWe offer an integral approach to architecture design, which enables us to provide the client with their ultimate vision.</p>\n\n<ul>\n	<li>Feasibility Studies</li>\n	<li>Site Analysis &amp; Evaluation</li>\n	<li>Conceptual Design</li>\n	<li>Schematic Design</li>\n	<li>Design Development and Detailed Design</li>\n	<li>Interior Design</li>\n	<li>Landscape Design</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://archiineergroup.la/images/upload/1570197856.jpg\" style=\"width:100%\" /></p>', 2, NULL, 0, 1, '2019-10-04 21:04:31', '2019-10-04 21:04:31', NULL),
(30, 'Civil / Structural Engineering', '<p>Archineer Associates has been providing Civil &amp; Structural Engineering services since its beginning, concentrating on Structure design, Foundation design of variety infrastructures .</p>\n\n<ul>\n	<li>Topographical survey</li>\n	<li>Soil investigation &amp; geotechnical evaluation</li>\n	<li>Earth retaining and slope protection structures</li>\n	<li>Pile and foundation design</li>\n	<li>Reinforced concrete and pre-stressed concrete structures</li>\n	<li>Steel structures</li>\n	<li>high-rise building and bridge structures</li>\n	<li>Road and highway</li>\n	<li>Storm drain and drainage</li>\n	<li>Transmission tower</li>\n	<li>Telecommunication tower</li>\n	<li>Elevated water tank tower</li>\n	<li>Hydropower dam and hydraulic structures</li>\n</ul>\n\n<p><span style=\"font-size:16px\"><strong>Structure Modeling</strong></span></p>\n\n<h4><img alt=\"\" src=\"https://archiineergroup.la/images/upload/1570198115.jpg\" style=\"width:100%\" /></h4>\n\n<p><span style=\"font-size:16px\"><strong>Deformation Shape</strong></span></p>\n\n<p><img alt=\"\" src=\"https://archiineergroup.la/images/upload/1570198171.jpg\" style=\"width:100%\" /></p>\n\n<p>&nbsp;</p>', 2, NULL, 0, 1, '2019-10-04 21:09:57', '2019-10-04 21:09:57', NULL),
(31, 'Mechanical / Electrical / Plumbing Engineering', '<p>We also provide the mechanical electrical and plumbing (MEP) engineering service. MEP is well recognized in providing clients with specific and comprehensive services from new building designs, retrofit or upgrade designs, building condition assessments, feasibility studies, energy audits, and overall system reviews.</p>\n\n<ul>\n	<li>Electrical System</li>\n	<li>Lightning Protection System</li>\n	<li>Telecommunication System</li>\n	<li>Computer Network System</li>\n	<li>PA System</li>\n	<li>CCTV System</li>\n	<li>MATV System</li>\n	<li>Access Control System</li>\n	<li>Fire Alarm System</li>\n	<li>Air Conditioning System</li>\n	<li>Ventilation System</li>\n	<li>Smoke Control System</li>\n	<li>Building Management System</li>\n	<li>Water Supply and Waste Water System</li>\n	<li>Fire Safety and Protection System</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:16px\"><strong>Mechanical Single Line Diagram</strong></span></p>\n\n<p><img alt=\"\" src=\"https://archiineergroup.la/images/upload/1570198465.jpg\" style=\"width:100%\" /></p>\n\n<p><span style=\"font-size:16px\"><strong>Electrical Schematic Diagram</strong></span></p>\n\n<p><img alt=\"\" src=\"https://archiineergroup.la/images/upload/1570198506.jpg\" style=\"width:100%\" /></p>\n\n<p><span style=\"font-size:16px\"><strong>Plumbing Diagram</strong></span></p>\n\n<p><img alt=\"\" src=\"https://archiineergroup.la/images/upload/1570198629.jpg\" style=\"width:100%\" /></p>', 2, NULL, 0, 1, '2019-10-04 21:17:43', '2019-10-04 21:17:43', NULL),
(32, 'Project Planning / Construction Management', '<p>Archineer Associates has combined experience in preparing the project master planning from the initial stage to project execution completion;<br />\n<br />\nLand use plans, feasibility studies and program management facility management for all rank of project from residential development, commercial centers, office building, community town,industrial complexes and urban planning.<br />\n<br />\nCONSTRUCTION Project management is a broad term encompassing a wide variety of activities. We can save time and budget on projects by applying proven administrative principles and techniques from pre-construction through project closeout.</p>\n\n<ul>\n	<li>Conduct pre-construction and weekly project meetings</li>\n	<li>Coordinate construction staking</li>\n	<li>Oversee contractor&rsquo;s activities and material testing</li>\n	<li>Track project quantities of materials</li>\n	<li>Prepare necessary change orders</li>\n	<li>Compile daily and weekly project diaries</li>\n	<li>Prepare payment vouchers</li>\n	<li>Complete government authority documentation</li>\n	<li>Conduct property owner meetings</li>\n	<li>Compose project update newsletters and press releases</li>\n</ul>\n\n<br>\n<div class=\"row\">\n    <div class=\"col-lg-6\">\n        <p style=\"font-weight: bold; font-size: 16px;\">Meeting with project owner</p>\n        <img src=\"https://archiineergroup.la/images/upload/1570198945.jpg\" alt=\"\" style=\"width: 100%;\">\n    </div>\n    <div class=\"col-lg-6\">\n        <p style=\"font-weight: bold; font-size: 16px;\">Site survey</p>\n        <img src=\"https://archiineergroup.la/images/upload/1570198963.jpg\" alt=\"\" style=\"width: 100%;\">\n    </div>\n</div>\n<br><br>\n<div class=\"row\">\n    <div class=\"col-lg-6\">\n        <p style=\"font-weight: bold; font-size: 16px;\">Meeting with project owner</p>\n        <img src=\"https://archiineergroup.la/images/upload/1570199065.jpg\" alt=\"\" style=\"width: 100%;\">\n    </div>\n    <div class=\"col-lg-6\">\n        <p style=\"font-weight: bold; font-size: 16px;\">Site survey</p>\n        <img src=\"https://archiineergroup.la/images/upload/1570199079.jpg\" alt=\"\" style=\"width: 100%;\">\n    </div>\n</div>', 2, NULL, 0, 1, '2019-10-04 21:22:12', '2019-10-04 21:32:25', NULL),
(33, 'Energy and Hydropower', '<p>In associated with our International consulting partner, ILF consulting engineers, we also provide design and consulting services in the field of hydropower, dam and river engineering focus on the sustainable use of water and on the protection against water-related hazards, considering the needs of the resident population and demonstrating a responsible approach towards the environment.<br />\n<br />\nWe support customers in developing new project ideas and in finding solutions to individual tasks. In order to check the viability of a project concept, our experts conduct technical and economic feasibility studies as well as environmental impact assessment studies. For selected projects, we take on the role of project developer, preparing tender documentation, support the customers in the evaluation of bids and draw up the contracts for project execution and also performs project management and control tasks and assumes full responsibility for the project we have been entrusted with.<br />\n<br />\nOur design and planning knowhow employ its capabilities in all project phases, from conceptual and permit application design, through detailed design and construction design. As part of these planning and design services, we also provide further services such as construction and operation permit negotiation, etc.<br />\n<br />\nAs construction supervisors on site we safeguard the interests of our clients throughout the project execution period and provide support to the clients to ensure successful completion of the project.<br />\n<br />\nWe elaborates operation and maintenance manuals, trains the staff and assists them during the commissioning and start-up phase</p>\n\n<ul>\n	<li>Elaboration of master plans to identify economically and ecologically feasible power plant sites in a specific area</li>\n	<li>Studies of alternatives</li>\n	<li>Socio-economic studies</li>\n	<li>Geological and geotechnical consulting services</li>\n	<li>Hydrological analyses</li>\n	<li>Steady-state and transient hydraulics</li>\n	<li>Overall design of hydropower plants, including electro-mechanical equipment and infrastructure</li>\n	<li>Design of rehabilitation works for existing hydropower plants</li>\n	<li>Studies on sedimentation and flushing of reservoirs</li>\n	<li>Preparation of documents for environmental impact assessments</li>\n	<li>Design works focusing on landscape protection and nature conservation</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://archiineergroup.la/images/upload/1570199628.jpg\" style=\"width:100%\" /></p>', 2, NULL, 0, 1, '2019-10-04 21:34:05', '2019-10-04 21:34:05', NULL),
(34, 'Information and Communication Technology', '<p>Archineer Associates provides all required for implementation of Communication and information Technology consulting and professional services in Lao PDR. We deeply design and management expertise in IT for businesses, government, and instutitions. Archiineer CIT was established the goal of providing smart It solution include:</p>\n\n<ul>\n	<li>Mobility</li>\n	<li>Cloud</li>\n	<li>IT outsourcing</li>\n	<li>Communication System Design</li>\n	<li>Computer Network System Design</li>\n	<li>Security and Access Control System Design</li>\n	<li>Data center</li>\n	<li>Digotal Signage System Design</li>\n	<li>Identification System Design</li>\n	<li>IT strategy and Policy Planning</li>\n	<li>Telecommunication Transformation Program</li>\n	<li>Others</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://archiineergroup.la/images/upload/1570200262.jpg\" style=\"width:100%\" /></p>', 2, NULL, 0, 1, '2019-10-04 21:44:34', '2019-10-04 21:46:14', NULL),
(35, 'Architect', '<p><strong>We are currently seeking architect positions:</strong><br />\n<br />\n<strong>Responsibilities</strong>&nbsp;Control project from start to finish to ensure high quality, innovative and functional design Take the &ldquo;brief&rdquo; to identify clients&rsquo; needs and put together feasibility reports and design proposals Develop ideas keeping in mind client&rsquo;s needs, building&rsquo;s usage and environmental impact Produce detailed blueprints and make any necessary corrections Compile project specifications Keep within budgets and timelines Ensure that all works are carried out to specific standards, building codes, guidelines and regulations Make on site visits to check on project status and report on project Cooperate and liaise with construction professionals Follow architectural trends and advancements.<br />\n<br />\n<strong>Requirements</strong>&nbsp;Proven working experience as an architect Strong portfolio to prove artistic skills Expert knowledge of building products, construction details and relevant rules, regulations and quality standards Excellent drawing skills and familiarity with design software (Adobe Photoshop, SketchUp, 3d Studio VIZ or similar) Strong imagination and the ability to think and create in three dimensions Visual awareness and an eye for detail Communication and project management skills BS degree in Architecture.</p>', 2, NULL, 0, 1, '2019-10-04 21:47:58', '2019-10-04 21:47:58', NULL),
(36, 'Engineer', '<p><strong>We are currently seeking engineer positions:</strong><br />\n<br />\n<strong>Civil engineer</strong><br />\n<strong>Responsibilities:</strong><br />\n&bull; Manage, design, develop, create and maintain small-scale through to large-scale construction projects in a safe, timely and sustainable manner<br />\n&bull; Conduct on site investigations and analyze data (maps, reports, tests, drawings and other)<br />\n&bull; Carry out technical and feasibility studies and draw up blueprints that satisfy technical specifications<br />\n&bull; Assess potential risks, materials and costs<br />\n&bull; Provide advice and resolve creatively any emerging problems/deficiencies<br />\n&bull; Oversee and mentor staff and liaise with a variety of stakeholders<br />\n&bull; Handle over the resulting structures and services for use<br />\n&bull; Monitor progress and compile reports in project status<br />\n&bull; Manage budget and purchase equipment/materials<br />\n&bull; Comply with guidelines and regulations including permits, safety etc and deliver technical files and other technical documentation as required<br />\n<br />\n<strong>M&amp;E engineer</strong><br />\n<strong>Responsibilities:</strong><br />\n&bull; designing and implementing cost-effective equipment modifications to help improve safety and reliability<br />\n&bull; developing a project specification with colleagues, often including those from other engineering disciplines<br />\n&bull; developing, testing and evaluating theoretical designs<br />\n&bull; discussing and solving complex problems with manufacturing departments, sub-contractors, suppliers and customers<br />\n&bull; making sure a product can be made reliably and will perform consistently in specified operating environments<br />\n&bull; managing projects using engineering principles and techniques<br />\n&bull; planning and designing new production processes<br />\n&bull; producing details of specifications and outline designs<br />\n&bull; recommending modifications following prototype test results<br />\n&bull; using research, analytical, conceptual and planning skills, particularly mathematical modelling and computer-aided design<br />\n&bull; considering the implications of issues such as cost, safety and time constraints<br />\n&bull; working with other professionals, within and outside the engineering sector<br />\n&bull; monitoring and commissioning plant and systems<br />\n&nbsp;</p>\n\n<p><strong>Requirements:</strong><br />\n&bull; Proven working experience in civil and M&amp;E engineering<br />\n&bull; Excellent knowledge of design and visualisations software such as AutoCAD,Civil 3D or similar<br />\n&bull; Proficiency in site layout, grading, utility design, erosion control, regulatory approvals etc<br />\n&bull; Project management and supervision skills<br />\n&bull; Strong communication and interpersonal skills<br />\n&bull; Licence of professional engineer<br />\n&bull; BS/MA in Civil Engineering</p>', 2, NULL, 0, 1, '2019-10-04 21:49:31', '2019-10-04 21:49:31', NULL),
(37, 'Project Manager / Coordinator', '<p>Archineer Associates Co.,Ltd. is a multi-disciplines consulting service firm that provides Architectural and Engineering design and consulting services to clients across an expansive range of markets and localities. Our multi-disciplinary services; Architecture, Civil &amp; Structural Engineering, Mechanical &amp; Electrical Engineering, Land Surveying and Planning; join forces, knowledge and experience to give you a single point of contact and a strong business relationship you can count on. Our office is located at Saphangmor Village, Saysetha District, Vientiane Capital, Lao PDR where we have started doing business.</p>\n\n<p>&nbsp;</p>\n\n<p>We are currently seeking the following positions:</p>\n\n<p><strong>Project Manager / Coordinator</strong><br />\n<strong>Responsibilities</strong><br />\n<br />\n<br />\n<br />\n<strong>Requirements</strong></p>', 2, NULL, 0, 1, '2019-10-04 21:50:44', '2019-10-04 21:50:44', NULL),
(38, 'Administrator', '<p>Archineer Associates Co.,Ltd. is a multi-disciplines consulting service firm that provides Architectural and Engineering design and consulting services to clients across an expansive range of markets and localities. Our multi-disciplinary services; Architecture, Civil &amp; Structural Engineering, Mechanical &amp; Electrical Engineering, Land Surveying and Planning; join forces, knowledge and experience to give you a single point of contact and a strong business relationship you can count on. Our office is located at Saphangmor Village, Saysetha District, Vientiane Capital, Lao PDR where we have started doing business.</p>\n\n<p>&nbsp;</p>\n\n<p>We are currently seeking the following positions:</p>\n\n<p><strong>Administrative officer</strong><br />\n<strong>Responsibilities</strong><br />\n<br />\n<br />\n<br />\n<br />\n<br />\n<strong>Requirements</strong></p>', 2, NULL, 0, 1, '2019-10-04 21:52:03', '2019-10-04 21:52:03', NULL),
