(43, 'People and Team', '<p>Archineer Associates continues to enhance the depth of our professional expertise and expand our operations with: 100+ qualified staff with doctoral and master degree and experienced top managing board and partners, and 80+ international and local architects, engineers and project managers working in an well organized team work.</p>\n\n<p><img alt=\"\" src=\"https://archiineergroup.la/images/upload/1570202955.jpg\" style=\"width:100%\" /></p>\n\n<p>&nbsp;</p>', 2, NULL, 0, 1, '2019-10-04 22:31:41', '2019-10-04 22:31:41', NULL),
